import React, {FC} from 'react';
import styled from 'styled-components';
import {IState} from '../../reducers';
import {useSelector} from 'react-redux';
import {ISingleUser} from '../../entities/users'
import {ISinglePhoto} from '../../entities/photos'
import {ISinglePost} from '../../entities/posts'

const Wrapper = styled.div`
width: 800px;
height: 1600px;
margin-left: 350px;


`;

const FirstBox = styled.div`
height: 1600px;
    width: 800px;
    padding-left:0;
    padding-top:auto;
    box-shadow:4px 4px 8px 1px #8e8e8e;
    border-radius:5px;  
`;

const BigImage = styled.img`

    width: 40px;
border-radius: 50%;
padding-right: 20%;
border: 1px solid black;
margin: 0px;
padding: 0;
margin-left: 30px;
margin-top: 30px;
`;

const See = styled.div `
margin-left: 30px;
padding-top:  10px;
`;

const SecondBox = styled.div`
margin-top: -10px;
margin-left: 150px;
`;

const ImgBox = styled.div`
	padding-top: 10px;
	width: 450px;
	justify-content: space-between;
	display: flex;
	margin-left: 340px;
	margin-top: 10px;
    `;
const Shanna = styled.div`
margin-left: 650px;
	margin-top: 0px;
`;
const Number = styled.div`
margin-left: 630px;
	margin-top: 10px;
`;
const PubIcon = styled.div`
margin-left: 0px;
margin-top: -70px;
`;
const SecBox = styled.div`
`;
const TwoBox = styled.div`
margin-left: 0px;
padding-top: -5px;
`;
const ThreeBox = styled.div`
margin-left: 0px;
padding-top: 15px;
`;

const ExperBox = styled.div`
margin-left: 30px;
margin-top: 20px;
color: #C0C0C0;
`;
const MergesBox= styled.div`
width: 150px;
height: 20px;
margin-left: 30px;
margin-top: 10px;
padding-left: 10px;
background-color: #ADD8E6;
color: blue;
display: flex;

	justify-content: space-between;
	display: flex;
    border-radius: 4px;
`;
const MergesBoxs= styled.div`
width: 150px;
height: 20px;
margin-left: 30px;
margin-top: -5px;
padding-left: 10px;
background-color: #ADD8E6;
color: blue;
display: flex;

	justify-content: space-between;
	display: flex;
    border-radius: 4px;
`;


const PanelBox = styled.div`
margin-top: 15px;
margin-left: 30px;
font-size: 19px;
`;

const HurTer = styled.div`
margin-top: 30px;
margin-left: 30px;
color: #C0C0C0;
`;
const MontHo = styled.div`
margin-top: 10px;
margin-left: 30px;
font-size: 16px;
`;
const AttachmentBox = styled.div`
width: 750px;
border-radius:5px;  
background-color: #C0C0C0;
margin-top: 10px;
margin-left: 30px;
`;
const CorpoBox = styled.div`
margin-top: 15px;
margin-left: 30px;
font-size: 16px;
`;
const InterBox = styled.div`
margin-top: 30px;
margin-left: 30px;
font-size: 18px;
`;
const NameBox =styled.div`
width: 750px;
margin-top: 10px;
display: flex;
    align-items: center;
    justify-content:flex-start;
    border-radius: 5px;
    margin-left: 30px;
background-color: #C0C0C0;
`;
const MiniatureImage = styled.img`
width: 20px;
border-radius: 50%;
margin-right: 10px;
border: 1px solid black;
margin: 10px;
padding: 0;
`;
const NameBoxs =styled.div`
width: 750px;
margin-top: 2px;
display: flex;
    align-items: center;
    justify-content:flex-start;
    border-radius: 5px;
    margin-left: 30px;
background-color: #C0C0C0;
`;

const DataBox = styled.div`
width: 950px;
margin-left:30px;
margin-top: 40px;
display: flex;
justify-content:space-around;
font-size: 18px;
`;

const InfoBox = styled.div`
width: 950px;
margin-left:30px;
margin-top: 10px;
display: flex;
justify-content:space-around;
font-size: 15px;
`;
const TableRow = styled.tr`
    width:100%;
    justify-content: space-between;
    padding-top:20px;
    display: flex;
    font-size:20px;
    color: #2a3a6b;
`;
const TableTitle = styled.th`
    width:200px;
    padding-top:10px;
`;
const TableRows = styled.tr`
    width:100%;
    justify-content: space-between;
    display: flex;
    font-size:15px;
    color: black;
`;
export const Profile: FC = () => {
    const usersList = useSelector<IState, ISingleUser[]>(state => state.users.usersList)
    const photosList = useSelector<IState, ISinglePhoto[]>(state => state.photos.photosList)
    const postsList = useSelector<IState, ISinglePost[]>(state => state.posts.postsList)
        
        return (    
            <Wrapper>
                <FirstBox>
            <ImgBox>
							<img style={{ width:"20px", height: '20px' }} src='../Media/icons/comment-regular.svg' alt='' />
							Message
							<img
								src='../Media/icons/sim-card-solid.svg'
								style={{ width: '20px', height: '20px' }}
								alt=''
							/>
					
							Create a request
                             <img
								src='../Media/icons/briefcase-solid.svg'
								style={{ width: '20px', height: '20px' }}
								alt=''
							/>
                                Add to a cluster
                                <img
								src='../Media/icons/times-solid.svg'
								style={{ width: '20px', height: '20px' }}
								alt=''
							/>
							</ImgBox>
            <SecBox>
            <BigImage src={photosList[5]?photosList[5].url:""} alt="" />
           <See>See profile</See> 
           
           <SecondBox>
           <PubIcon>
               <div>
               <h4>{usersList?.[2]?.name}</h4>
               <img style={{ width:"20px", height: '20px', marginLeft:'620px', marginTop:'-10px'}} src='../Media/icons/pencil-alt-solid.svg' alt='' />
               </div>
               </PubIcon> 
           <TwoBox><h4>{usersList?.[1]?.name}</h4></TwoBox> 
            <ThreeBox>Wisokyburgh</ThreeBox>
           
            </SecondBox>
            </SecBox>
